import React, { Component } from 'react';

class CardTitle extends Component {

	constructor(props){
    super(props);

    this.state = {
      language: '',
      category: '',
      status: ''
    }
    
    this.setState({
      language: 'Language',
      category: 'Category',
      status: 'status'
    })
  }

  render() {
    return (
      <div id="preview-Title"><span>this.state.language</span> this.state.category</div>
    );
  }

}

export default CardTitle;
